import { Col, Row } from 'react-bootstrap';
import TableItem from './TableItem';
function Table() {
  return (
    <Row className="mt-4">
      <Col md={12}>
        <table className="w-100">
          <tr style={{ color: '#355361', fontSize: '18px', letterSpacing: '1px' }}>
            <th>Status</th>
            <th>Date</th>
            <th>Client</th>
            <th>Currency</th>
            <th>Total</th>
            <th>Invoice</th>
            <th>Action</th>
          </tr>
          <TableItem />
          <TableItem />
          <TableItem />
        </table>
      </Col>
    </Row>
  );
}

export default Table;
